import React from "react";

const Todos = ({ todos, addTodo }) => {
  console.log("Child Member");
  return (
    <>
      <h1>My Todos</h1>
      <button onClick={addTodo}>Add Todo</button>
      {todos.map((todo, index) => {
        return <p key={index}>{todo + index}</p>;
      })}
    </>
  );
};

export default Todos;
